import '../index.css'
import React from 'react';
import { Link } from 'react-router-dom';



export const Navbar = () =>{

    const user = {
        name: 'Adison',
        surname: 'Gonsior',
        city: 'Bielsko',
      }

    return(
        <div className='navbar'>

            <button>
                <Link to='/'>Home</Link>
            </button>
            <button>
                <Link to='/contact'>Kontakt</Link>
            </button>
            <button>
                <Link to='/more'>More</Link>

            </button>
        </div>
    )
}
